import React from 'react'
import { NavLink } from 'react-router-dom'
import { LOGOUT } from '../../redux/actions/authActions'


function SignedIn() {
    return (
     <React.Fragment>
        <ul id='dropdown1' className='dropdown-content'>
            <li><NavLink to="/profile">My Profile<i className="material-icons">person</i></NavLink></li>  
            <li><NavLink to="/" onClick={this.props.LOGOUT()}>Logout<i className="material-icons">power_settings_new</i></NavLink></li>  
        </ul>
        <ul className="right">
            <li><NavLink to="/"><i className="material-icons">collections</i></NavLink></li>
            <li><NavLink to="/"><i className="material-icons">add_a_photo</i></NavLink></li>
            <li><NavLink to="/" className="dropdown-trigger" id="dropdowner" data-target="dropdown1"><img style={{width:"40px",height:"40px",borderRadius:"40px",verticalAlign:"middle"}} src="https://avatars2.githubusercontent.com/u/51698550?s=460&u=b2a9911e8c6e6dc7f76328e3a3495a60a043b869&v=4"/><i className="material-icons right">arrow_drop_down</i></NavLink></li>
        </ul> 
     </React.Fragment>   
    )
}

const mapDispatchToProps=(dispatch)=>{
    return {
      LOGOUT:()=>{dispatch(LOGOUT())}
    }
  }

export default connect(null,mapDispatchToProps)(SignedIn);
